function App(){
  return(
     <div>
       <Routes>
          <Route path="/" element={<Home/>}/>
          <Route path="/about" element={<About/>}/>
          <Route path="/footer" element={<Footer/>}/>
      </Routes>
    </div>
  )
}
export default App;
